import React from 'react'

function CommentsList(props) {
    return (
        <div>
            <ul id="commentlist" className= "commentlist">  
            {props.videos
                .filter((video) => video.id !== props.currentVideo)
                .map((video) => (
                <li key={video.id}>
                    <h3>{video.title}</h3>
                    <img src={video.image} alt="" />
                </li>
            ))}
            </ul> 
        </div>
    )
}

export default CommentsList
